import React from 'react';
import './App.css';
import { MDBBtn } from 'mdb-react-ui-kit';
import "@material-ui/core";
import { Button } from '@material-ui/core';
import { MDBInput } from 'mdb-react-ui-kit';

function SortByContent() {
    return (
        <div className="sort_table">
            <div className="search_property">
            <MDBInput label='Example label' id='form5' type='text' />
            </div>
            <div className="property_list"></div>
            <div className="rooms_list"></div>
            <div className="property_price"></div>
            <MDBBtn className="hero_button">Button</MDBBtn>
            
        </div>
    )
}

export default SortByContent
